/02/header-section3-part1-img.png\" alt=\"\" class=\"wp-image-103\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"className\":\"home-section3-part1-p\"} -->\n<p class=\"home-section3-part1-p\">INY VINTAGE CHAIR</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {\"className\":\"home-section3-part1-button\"} -->\n<div class=\"wp-block-buttons home-section3-part1-button\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">VIEW DETAILS</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"home-section3-part2-container\"} -->\n<div class=\"wp-block-column home-section3-part2-container\"><!-- wp:columns {\"className\":\"home-section3-part2-container\"} -->\n<div class=\"wp-block-columns home-section3-part2-container\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":104,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"home-section3-part2-img\"} -->\n<figure class=\"wp-block-image size-full home-section3-part2-img\"><img src=\"http://slutprojekt.test/wp-content/uploads/2024/02/header-section3-part2-img.png\" alt=\"\" class=\"wp-image-104\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"className\":\"home-section3-part2-p\"} -->\n<p class=\"home-section3-part2-p\">LARGE TERRACOTA<br>VASE</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {\"className\":\"home-section3-part2-button\"} -->\n<div class=\"wp-block-buttons home-section3-part2-button\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">VIEW DETAILS</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --